import './Footer.css';

const Footer = () => {
  return (
    <div className='footer-container'>
      <div className='footer-contact-info'>
        <h3>Contact info:</h3>
        <div className='footer-phone-box'>
          <div className='footer-phone-icon-containder'>
            <i className="fa-solid fa-phone"></i>
          </div>
          <div>
            <p>Call Us For A Free Quote!</p>
            <a href='tel:661-202-8255'>661-202-8255</a>
          </div>
        </div>
        <p>Tahar Garage Door Services</p>
        <p>2814 Deerborn Ave.</p>
        <p>Palmdale, California</p>
      </div>

      <div>

      </div>
    </div>
  );
};

export default Footer;
